import React from 'react';
import './Header.css';
import banner from '../assets/clinic-banner.png'; // replace with your correct path
import logo from '../assets/clinic-logo.png';     

const Header = () => {
  return (
    <div className="header-background" style={{ backgroundImage: `url(${banner})` }}>
      <div className="header-card">
        <img src={logo} alt="DentalBuddy Logo" className="clinic-logo" />
        <div className="header-text">
          <h1 className="clinic-name">DENTALBUDDY</h1>
          <p className="tagline">Your Complete Dental Practice Manager</p>
        </div>
      </div>
    </div>
  );
};

export default Header;
